      SELECT DISTINCT * FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT ( NULL ) BETWEEN col0 * + col1 * - ( - col2 ) / + col1 + 68 * - 20 AND - 31 + + 46 * - 71;
  - name: tab2

outputs:
  - name: q1410.out
    data: |
